"use strict";(self.webpackChunk_tc_server_widgets=self.webpackChunk_tc_server_widgets||[]).push([[384],{3920:function(e){e.exports=JSON.parse('{"domain":"messages","locale_data":{"messages":{"":{"domain":"messages","plural_forms":"nplurals=2; plural=n > 1;","lang":"fr_FR"},"Only a predefined number of video windows can be added to this layout":["Seul un nombre prédéfini de fenêtres vidéo peut être ajouté à cette mise en page"],"Button\\u0004Add":["Ajouter"],"Button\\u0004Apply":["Appliquer"],"Button\\u0004Additional":["Supplémentaires"],"Button\\u0004Cancel":["Annuler"],"Button\\u0004Layout type":["Type du mode d\'affichage"],"Heading\\u0004Select a participant":["Sélectionner un participant"],"Heading\\u0004Add users":["Ajouter des utilisateurs"],"Order number of the video window occupied by a participant\\u0004Video window":["Fenêtre vidéo"],"Order number of the video window occupied by a participant\\u0004video window #%slot":["fenêtre vidéo #%slot"],"Popup header\\u0004Individual layout for":["Mode d\'affichage individuel pour"],"Message\\u0004Not found":["Non trouvé"],"Message\\u0004Too many search results. Please refine your search criteria.":["Trop de résultats de recherche. Veuillez affiner vos critères de recherche."],"Message\\u0004The list is empty":["La liste est vide"],"Message\\u0004The user will be invited to the conference via email":["L\'utilisateur sera invité à la conférence par e-mail"],"Message\\u0004HTTPS not enabled.":["HTTPS n\'est pas activé."],"Message\\u0004This feature requires HTTPS to ensure your data safety.":["Cette fonctionnalité nécessite HTTPS pour assurer la sécurité de vos données."],"Message\\u0004To solve this problem please contact your server administrator.":["Pour résoudre ce problème, veuillez contacter votre administrateur de serveur."],"Message\\u0004List is empty":["La liste est vide"],"Message\\u0004Recording is disabled for all conferences on the server":["Enregistrement désactivé pour toutes les conférences sur le serveur"],"Message shown for empty list\\u0004Individual layouts have been created for all participants":["Des mises en page individuelles ont été créées pour tous les participants"],"Message shown for empty list\\u0004No items to display.":["Aucun élément à afficher."],"A subheader in the pop-up\\u0004Not displayed in the layout":["Pas visible avec le mode d\'affichage sélectionné"],"Subheader\\u0004Participants displayed in the layout":["Participants visibles en mode d\'affichage sélectionné"],"Subheader\\u0004Your administrator":["Votre administrateur"],"Subheader\\u0004Phone":["Téléphone"],"Subheader\\u0004Email":["E-mail"],"Subheader\\u0004Participants not displayed in the layout":["Participants non visibles dans le mode d\'affichage sélectionné"],"A text hint displayed for a group of conference participants who cannot be added to the layout. These users cannot be added to the layout because they will be acting as interpreters in a multi-language meeting (they are not supposed to be seen by other participants).\\u0004Cannot be added to the layout":["Ne peut pas être ajouté à la mise en page"],"A text hint displayed for one of the conference participants. The hint indicates that this person will act as an interpreter during a multi-language meeting. The word “interpreter” should be in the nominative case.\\u0004Interpreter":["Interprète"],"The button that replaces the participant in the video slot.\\u0004Replace":["Remplacer"],"The title of an input field\\u0004Name displayed in the video layout":["Visualisation du nom en mode d\'affichage"],"Error message\\u0004The field cannot be empty":["Le champ ne peut pas être vide"],"Error message\\u0004Unfortunately, your administrator did not leave any contact details.":["Malheureusement, votre administrateur n’a pas laissé les coordonnées."],"Error message\\u0004The conference session has ended":["La séance de conférence est terminée"],"Error message\\u0004Value is already in use. Please try another.":["La valeur est déjà en cours d’utilisation. Veuillez essayer une autre."],"Error message\\u0004The form has been filled incorrectly.":["Le formulaire a été rempli de manière incorrecte."],"Error message\\u0004Number of characters in the field is 4-10.":["Le nombre de caractères dans le champ est 4-10."],"A text hint displayed to a conference moderator. The hint indicates that it is no longer possible to select a participant and invite him/her to the podium. To be on the “podium” means that a participant can be seen and heard by users who take part in a video meeting. The number of “podiums” is limited. Please check how the word “podium” was previously translated into the target language.\\u0004Unable to select. The maximum number of podiums has been exceeded":["Impossible de sélectionner. Nombre maximum de podiums dépassé"],"A text hint indicating that a layout window is intended for a certain participant. This person will be constantly displayed in this window. If this participant does not join the meeting, this window will remain empty.\\u0004Fixed":["Fixe"],"A text hint displayed to a conference moderator. He/she can configure settings for different windows. Moreover, one can change the type of a video window. For example, some windows can be used for displaying content while others will be displaying content. In this case, one cannot change the type of a video window due to certain restrictions.\\u0004Unable to change the type":["Impossible de modifier le type"],"A text hint displayed to a conference moderator. Please note that a “smart meeting” is a type of conference in which a participant can automatically become seen and heard as soon as he/she starts speaking. Moreover, this person does not have to ask for the moderator’s permission. The term “smart meeting” was selected due to marketing reasons and it is already used in the UI. So, please check how it was previously translated into the target language. Besides, an “Active speaker” slot is a type of video window used for displaying a participant who is speaking at the moment. So, if possible, please check how the term “Active speaker”  was previously translated into the target language.\\u0004In “smart meeting” mode, there must be at least two “Active speaker” slots in the layout":["En mode \\"réunion intelligente\\", il doit y avoir au moins deux emplacements \\"Intervenant actif\\" dans la mise en page"],"A text hint indicating that a randomly-selected participant will be displayed in the video layout.\\u0004Random":["Aléatoire"],"A text hint indicating that a randomly-selected participant will be displayed in the video window (slot) of the layout.\\u0004A random participant  will be displayed in this slot":["Un participant aléatoire sera affiché dans cet emplacement"],"A text hint indicating that a video window will be used for displaying randomly selected participants. These participants can be moved from one window to another or replaced with a different participant. To some degree, this movement will be similar to card shuffling. However, you don’t have to translate the word “shuffling” verbatim.\\u0004Time-based shuffling":["Mélange basé sur le temps"],"A text hint indicating that a certain video window will be used for displaying a randomly selected conference participant. These participants will be rotated (alternated) every 30 or 60 seconds. The word “every” will be followed by the number of seconds. \\u0004Randomly participants will be alternated in this window every:":["Les participants seront alternés de manière aléatoire dans cette fenêtre à chaque fois :"],"The abbreviation for the word “seconds”. It is a part of the phrase like “conference participants will be rotated every 5 sec.” The shortened version of the word “seconds” is used here so that its ending does not depend on the preceding numeral.\\u0004sec.":["sec"],"A text hint indicating that the video window will be used for displaying the participant who will be speaking at the moment.\\u0004Active speaker":["Orateur actif"],"A text hint describing who will be displayed in the video window.\\u0004The participant, who is speaking at the moment, will be displayed in this slot":["Le participant qui parle en ce moment s\'affiche dans cet emplacement"],"A text hint indicating that a video window will be used for sharing content (e.g., slides, images, app windows, and so forth).\\u0004Content ":["Contenu "],"A text hint displayed to a user who is configuring the settings of a slot (window)  in the layout created for a video meeting. In this case, the word “content”  may refer to slides, PDF documents, and application windows.\\u0004The slot will be used for sharing content. This slot can be selected only once":["L\'emplacement sera utilisé pour le partage de contenu. Cet emplacement ne peut être sélectionné qu\'une seule fois"],"A text hint indicating that no participant or content is currently displayed in the certain layout window.\\u0004Empty slot":["Emplacement vide"],"A text hint indicating that a user can select a participant who will be displayed in the video layout.\\u0004Select a participant":["Sélectionner un participant"],"The sidebar heading. Here, a user can configure the settings of a video window (slot). Please note that %n will be replaced with the window number. So, do not delete or edit this part of the sentence.\\u0004Slot %n settings":["Paramètres de l\'emplacement %n"],"An error message. An access token is an object required to provide users of one server access to the user groups of other server.\\u0004Access token of your server to the %host_name is invalid or has expired.":["Le jeton d\'accès de votre serveur au %host_name est invalide ou a expiré."],"A notification\\u0004Please try again within an hour or contact your server administrator.":["Veuillez réessayer dans une heure ou contactez votre administrateur du serveur."],"An error message\\u0004Failed to connect to the %host_name server.":["Impossible de se connecter au serveur %host_name."],"An error message\\u0004Something went wrong.":["Une erreur s\'est produite."],"An error message. An SSL certificate is a file needed to make sure that all the information shared between a user and a website remains private.\\u0004SSL certificate verification failed.":["La vérification du certificat SSL a échoué."],"A text hint\\u0004To add the server address to the exception list in your browser, please continue to %host_name website and follow the instructions on the page.":["Pour ajouter l\'adresse du serveur à la liste des exceptions dans votre navigateur, veuillez continuer sur le site %host_name et suivre les instructions de la page."],"A text hint\\u0004Select a layout for":["Sélectionner le mode d\'affichage pour"],"The button enabling a user to go to the website\\u0004Continue":["Continuer"],"A text hint. The word will be followed by an error code such as 402.\\u0004Error code: %error_code":["Code d\'erreur : %error_code"],"Name of group\\u0004Added users without group":["Utilisateurs ajoutés sans groupe"],"Name of group\\u0004Users without group":["Utilisateurs sans groupe"],"Text on the button\\u0004Load more":["Charger plus"],"Text on the button\\u0004Select ID":["Sélectionner l\'identifiant"],"Text on the button\\u0004Address book":["Carnet d\'adresses"],"Text on the button\\u0004All users":["Tous les utilisateurs"],"Text on the button\\u0004Select":["Sélectionner"],"Text on the button\\u0004Cancel":["Annuler"],"Text on the button\\u0004Add":["Ajouter"],"Text on the button\\u0004Contacts":["Contacts"],"Text on the button\\u0004Email":["E-mail"],"Text on the button\\u0004Selected":["Sélectionné"],"Text on the button\\u0004Add by id":["Ajouter par id"],"Text on the button\\u0004Contact administrator":["Contacter l\'administrateur"],"Text on the button\\u0004Disconnect":["Se déconnecter"],"Text on the button\\u0004Back to top":["Revenir en haut"],"Text on the button\\u0004Collapse all":["Réduire tout"],"Text on the button\\u0004Remove":["Supprimer"],"Text on the button\\u0004Confirm":["Confirmer"],"An error message. A conference ID is an identifier of a virtual meeting. The identifier can be shared with conference participants so that they could join the meeting. The hint is supposed to tell a user that he/she is trying to do something which is\\u0004You cannot add a conference ID as a participant":["Vous ne pouvez pas ajouter un ID de conférence comme participant"],"The button for selecting several users\\u0004Select":["Sélectionner"],"The button for unmarking selected users\\u0004Deselect":["Désélectionner"],"Hint\\u0004Displayed: [b]%n[/b] group users":["Texte affiché : utilisateurs du groupe [b]%n[/b]"],"Hint\\u0004Enter a user\'s name/ID or an endpoint ID":["Nom d\'utilisateur/ID ou un identifiant de périphérique"],"Hint\\u0004Search":["Rechercher"],"Hint\\u0004Groups":["Groupes"],"Hint\\u0004Name":["Nom"],"Hint\\u0004Email":["E-mail"],"Hint\\u0004Control panel is available only to conference owners and operators":["Le panneau de contrôle est disponible uniquement aux hôtes et opérateurs des conférences"],"Hint\\u0004Enter user’s name, ID or email address":["Entrez le nom, l\'ID ou l\'adresse e-mail de l\'utilisateur"],"Hint\\u0004There is no set layout":["Il n\'y a pas de mode d\'affichage défini"],"Hint\\u0004Conference details":["Détails de la conférence"],"Title\\u0004User":["Utilisateur"],"Title\\u0004TrueConf ID":["TrueConf ID"],"Title\\u0004Email":["E-mail"],"Title\\u0004Groups":["Groupes"],"Title\\u0004Access denied":["Accès refusé"],"Title\\u0004First name":["Prénom"],"Title\\u0004Last name":["Nom de famille"],"Title\\u0004Company":["Entreprise"],"Title\\u0004Mobile phone":["Téléphone portable"],"Title\\u0004Work phone":["Téléphone de travail"],"Title\\u0004Home phone":["Téléphone fixe"],"A table column header. Here, the administrator can check information about the license given to a user on a temporary basis. In particular, he/she can check when this license will cease to be active. It does not mean that the license will expire.\\u0004License will be active until":["La licence sera active jusqu\'au"],"The tooltip that appears when hovering a user whose account was deactivated by the admin.\\u0004Account is inactive":["Le compte est inactif"],"Subtext\\u0004How to add endpoints":["Comment ajouter des points de terminaison"],"Title of button\\u0004Export to CSV (format compatible with %product_name)":["Exporter vers CSV (format compatible avec %product_name)"],"Hint, appears after clicking the button to add email address\\u0004Address selected":["Adresse sélectionnée"],"Hint, appears after clicking the button to add email address\\u0004User already added":["Utilisateur déjà ajouté"],"Header\\u0004Add participants":["Ajouter des participants"],"Header\\u0004Hardware setup (%name)":["Configuration des périphériques (%name)"],"Header\\u0004User profile":["Profil utilisateur"],"Search field hint\\u0004Search":["Recherche"],"A conferencing mode where all participants can see and hear one another\\u0004All on screen":["Tous sur l\'écran"],"A conferencing mode for distance education\\u0004Video lecture":["Vidéo conférence"],"A conferencing mode. A role-based conference is a video meeting where only some participants are allowed to share their audio and video while other users cannot be heard and seen. To be on the podium means that a user can be seen and heard by conference participants. If a user is not on the podium, he/she cannot be seen or heard by others\\u0004Role-based":["Basée sur rôle"],"Day of the Week\\u0004Monday":["Lundi"],"Day of the Week\\u0004Tuesday":["Mardi"],"Day of the Week\\u0004Wednesday":["Mercredi"],"Day of the Week\\u0004Thursday":["Jeudi"],"Day of the Week\\u0004Friday":["Vendredi"],"Day of the Week\\u0004Saturday":["Samedi"],"Day of the Week\\u0004Sunday":["Dimanche"],"Day of the Week (abbreviation)\\u0004Mon":["Lun"],"Day of the Week (abbreviation)\\u0004Tue":["Mar"],"Day of the Week (abbreviation)\\u0004Wed":["Mer"],"Day of the Week (abbreviation)\\u0004Thu":["Jeu"],"Day of the Week (abbreviation)\\u0004Fri":["Ven"],"Day of the Week (abbreviation)\\u0004Sat":["Sam"],"Day of the Week (abbreviation)\\u0004Sun":["Dim"],"Month\\u0004January":["Janvier"],"Month\\u0004February":["Février"],"Month\\u0004March":["Mars"],"Month\\u0004April":["Avril"],"Month\\u0004May":["Mai"],"Month\\u0004June":["Juin"],"Month\\u0004July":["Juillet"],"Month\\u0004August":["Août"],"Month\\u0004September":["Septembre"],"Month\\u0004October":["Octobre"],"Month\\u0004November":["Novembre"],"Month\\u0004December":["Décembre"],"Text hint\\u0004User will be invited to the conference via email":["L\'utilisateur sera invité à la conférence par e-mail"],"Button to add email address to send invitation to the conference\\u0004Select":["Sélectionner"],"The name of the tab which contains address book contacts\\u0004Contacts":["Contacts"],"The name of the tab where you can send user an email invitation to the conference\\u0004Via email":["Par e-mail"],"The name of the tab where the users marked for adding are located\\u0004Selected":["Sélectionné"],"A notification displayed if a user locks a conference or makes it inaccessible to new participants. The hint indicates that in such a case email invitations cannot be sent to participants.\\u0004Email invitations are disabled when the conference is locked.":["Les invitations par e-mail sont désactivées lorsque la conférence est verrouillée."],"Input field name\\u0004Name":["Nom"],"Input field name\\u0004Email":["E-mail"],"Input field error\\u0004This isn\'t correct email":["Ce n\'est pas un e-mail correct"],"For multiselect\\u0004Selected:":["Sélectionné :"],"Button designed to invite user to the conference again\\u0004Re-invite":["Réinviter"],"Context menu item for conference participant\\u0004Invite to podium":["Inviter à la tribune"],"Context menu item for conference participant\\u0004Remove from podium":["Retirer de la tribune"],"Context menu item for conference participant\\u0004Disconnect participants":["Déconnecter les participants"],"Context menu item for conference participant\\u0004Invite":["Inviter"],"Context menu item for conference participant\\u0004Disconnect participant":["Déconnecter le participant"],"Context menu item for conference participant\\u0004Turn on the camera":["Allumer la caméra"],"Context menu item for conference participant\\u0004Turn off the camera":["Éteindre la caméra"],"Context menu item for conference participant\\u0004Unmute the microphone":["Activer le microphone"],"Context menu item for conference participant\\u0004Mute the microphone":["Désactiver le microphone"],"Context menu item for conference participant\\u0004Hardware setup":["Configuration des périphériques"],"Context menu item for conference participant\\u0004Dismiss from moderators":["Destituer le modérateur"],"Context menu item for conference participant\\u0004Assign as a moderator":["Assigner en tant que modérateur"],"Context menu item for conference participant\\u0004Unselect":["Déselectionner"],"Context menu item for conference participant\\u0004Select":["Sélectionner"],"Context menu item for conference participant\\u0004Customize video layout":["Personnaliser le mode d\'affichage"],"A text hint displayed when a mouse cursor is pointed to the button. If this option is selected, a user will not be seen by other conference participants.\\u0004Turn off the video":["Désactiver la vidéo"],"A text hint displayed when a mouse cursor is pointed to the button. If this option is selected, the selected user will be seen and heard by other conference participants\\u0004Turn on the video":["Activer la vidéo"],"A text hint displayed when a mouse cursor is pointed to the button. If this option is selected, a user will not be heard by other conference participants.\\u0004Mute microphone":["Désactiver le microphone"],"A text hint displayed when a mouse cursor is pointed to the button. If this option is selected, a user will be heard by other conference participants.\\u0004Unmute microphone":["Activer le microphone"],"Error\\u0004This conference ID does not exist":["Cet ID de conférence n\'existe pas"],"Error\\u0004Error":["Erreur"],"Error\\u0004The number of speakers exceeded":["Le nombre d\'intervenants est dépassé"],"The heading for the notification displayed to a user when he/she is logged out of the web application. The user could be logged out because he/she stayed inactive for a certain time.\\u0004Your session has expired":["Votre session a expiré"],"This message is displayed when a user does not have access to application settings\\u0004Try to open this window once again or contact your server administrator":["Essayez d\'ouvrir cette fenêtre à nouveau, ou contactez votre administrateur de serveur"],"A text hint displayed to a user who wants to access the web application.\\u0004Please sign in again to access the personal area.":["Veuillez vous identifier à nouveau pour accéder à l\'espace personnel."],"The heading for a dialogue window. This display name is the name which is shown in the video layout during a conference. The term “display name” is already used in the UI so; please check how it was translated into the target language before. In the dialogue window, the meeting moderator can change the display name of a participant (he/she can type a new name).\\u0004Changing display name":["Changement du nom d\'affichage"],"The button that will close the dialogue window.\\u0004Cancel":["Annuler"],"The button that will save the changes. made by the user.\\u0004Save":["Sauvegarder"],"Dropdown menu item\\u0004None":["Aucun"],"Dropdown menu item\\u0004Clear":["Effacer"],"Dropdown menu item\\u0004Make large":["Augmenter la taille de l\'onglet"],"Dropdown menu item\\u0004Make small":["Réduire la taille de l\'onglet"],"Dropdown menu item\\u0004Auto-fill layout":["Disposition de remplissage automatique"],"Dropdown menu item\\u0004Clear layout":["Effacer le mode d\'affichage"],"Dropdown menu item\\u0004Delete layout":["Supprimer la mise en page"],"Dropdown menu item\\u0004Select":["Sélectionner"],"The heading of a pop-up window. Here, a user can select the audio channel that he/she wants to receive during a video meeting. Please note that here we are talking about a multi-language meeting assisted by interpreters. In this case, %Displayname is the name of the user. Do not delete or edit this part of the sentence.\\u0004Select interpretation channel (%Displayname)":["Sélectionnez le canal d\'interprétation (%Displayname)"],"The original audio stream received by the translator during a multi-language meeting. This stream will be translated to other languages.\\u0004Original audio":["Audio original"],"Item in the list of languages\\u0004English":["Anglais"],"Item in the list of languages\\u0004Russian":["Russe"],"Item in the list of languages\\u0004Chinese":["Chinois"],"Item in the list of languages\\u0004Farsi":["Persan"],"Item in the list of languages\\u0004French":["Français"],"Item in the list of languages\\u0004German":["Allemand"],"Item in the list of languages\\u0004Italian":["Italien"],"Item in the list of languages\\u0004Japanese":["Japonais"],"Item in the list of languages\\u0004Polish":["Polonais"],"Item in the list of languages\\u0004Czech":["Tchèque"],"Item in the list of languages\\u0004Portuguese":["Portugais"],"Item in the list of languages\\u0004Spanish":["Espagnol"],"Item in the list of languages\\u0004Ukrainian":["Ukrainien"],"Item in the list of languages\\u0004Vietnamese":["Vietnamien"],"Item in the list of languages\\u0004Hebrew":["Hébreu"],"Item in the list of languages\\u0004Korean":["Coréen"],"Item in the list of languages\\u0004Turkish":["Turc"],"A pop-up title\\u0004Removing participants":["Retrait des participants"],"The title of a checkbox in the pop-up window displayed when a moderator removes a participant (or participants) from a video conference. If this box is checked, the selected participants will not be able to join the conference once again (reconnection).\\u0004Reconnection is not allowed":["Reconnexion non autorisée"],"A question in the pop-up window\\u0004Do you want to remove the selected participants from the conference?":["Voulez-vous retirer les participants sélectionnés de la conférence ?"],"Confirmation window\\u0004Are you sure you want to disconnect the participant %DN from the conference?":["Êtes-vous sûr de vouloir déconnecter le participant %DN de la conférence ?"],"Confirmation window\\u0004Delete the \\"%layout\\" layout?":["Supprimer le mode d\'affichage \\"%layout\\" ?"],"The heading of a dialogue window. To be on the podium means that a user can be seen and heard by other conference participants. Please note that the word “podium” is already used in the UI. So, you need to check how this word was previously translated into the target language. In this section, a user can check how the podiums will be filled by conference participants.\\u0004Filling podiums":["Remplissage des podiums"],"A text hint in the pop-up window. To be on the podium means that a user can be seen and heard by other conference participants. There is a limited number of “podiums” in a conference. This term is already used in the UI so, you need to check how this word was previously translated into the target language. Besides, for each conference there may be multiple layouts (arrangement of video windows).\\u0004The counter indicates how many podiums are vacant in all conference layouts":["Le compteur indique combien de podiums sont vacants dans toutes les mises en page de la conférence"],"A text hint in the pop-up window. To be on the podium means that a user can be seen and heard by other conference participants. There is a limited number of “podiums” in a conference. This term is already used in the UI so, you need to check how this word was previously translated into the target language. In turn, a conference mode is a fixed group of settings for a video meeting.\\u0004The maximum number of podiums depends on the selected conference mode.":["Le nombre maximal de podiums dépend du mode de conférence sélectionné."],"A text hint in the pop-up window. To be on the podium means that a user can be seen and heard by other conference participants. There is a limited number of “podiums” in a conference. This term is already used in the UI so, you need to check how this word was previously translated into the target language. Besides, each conference may have multiple independent layouts.\\u0004The repeated display of the same participant in different layouts does not decrease the number of available podiums":["L\'affichage répété d\'un même participant dans différentes présentations ne réduit pas le nombre de podiums disponibles"],"Text in pop-up. The user can create a public conference opened to all participants. They only need to sign up (register) for this event. Under such circumstances, the use of PIN will be unavailable.\\u0004PIN is unavailable when conference registration is enabled":["Le code PIN n\'est pas disponible lorsque l\'inscription à la conférence est activée"],"The button for closing the pop-up window.\\u0004Close":["Fermer"],"A heading for one of the sections in the address book. In this section, the administrator can select conference participants\\u0004Select participants":["Sélectionner les participants"],"A subheading in the conference settings menu. In this subsection, a user will determine for how long a meeting can be extended\\u0004Extending conference time":["Prolongation du temps de la conférence"],"A notification displayed in the dialogue window\\u0004Extend conference time for":["Prolonger la durée de la conférence pour"],"A notification displayed in the dialogue window\\u0004The conference will end in %n minutes.":["La conférence se terminera dans %n minutes."],"A button\\u0004Cancel":["Annuler"],"A button\\u0004Apply":["Appliquer"],"A notification indicating that a video meeting was extended\\u0004The conference was extended for %n minutes":["La conférence a été prolongée de %n minutes"],"An option in the drop-down list. By clicking on one of the options from this list, a user will extend the conference for a certain period like 15 minutes, an hour or two hours\\u000415 min":["15 min"],"An option in the drop-down list. By clicking on one of the options from this list, a user will extend the conference for a certain period like 15 minutes, an hour or two hours\\u000430 min":["30 min"],"An option in the drop-down list. By clicking on one of the options from this list, a user will extend the conference for a certain period like 15 minutes, an hour or two hours\\u00041 hour":["1 heure"],"An option in the drop-down list. By clicking on one of the options from this list, a user will extend the conference for a certain period like 15 minutes, an hour or two hours\\u00042 hours":["2 heures"],"A text hint displayed when the mouse cursor is pointed to the icon.\\u0004Volume level":["Niveau du volume"],"A text hint displayed when a mouse cursor is pointed to the button.\\u0004Turn down microphone volume":["Baisser le volume du microphone"],"A text hint displayed when a mouse cursor is pointed to the button.\\u0004Turn up microphone volume":["Augmenter le volume du microphone"]," A pop-up hint for a drop-down list with the options for managing a person, participating in a video conference. It will be possible to change the settings of the participant’s camera/microphone, appoint him/her as a moderator, or remove from the ongoing conference.\\u0004More":["Plus"],"A pop-up hint displayed for a button. Please note that this hint is not an error message. It just indicates that a user is trying to do something which is not allowed by the application\\u0004You cannot remove yourself from the conference":["Vous ne pouvez pas vous retirer de la conférence"],"A text hint displayed to a moderator when he/she tries to remove a participant from a video meeting. This hint will be displayed if the participant selected by the moderator is the person who scheduled and created the conference (in other words, he/she is the owner of the conference). Please note that the word “owner” is already used in the GUI. So, you need to check how this word was previously translated into the target language.\\u0004You cannot remove the owner from the conference":["Vous ne pouvez pas retirer le propriétaire de la conférence"],"An option in the context menu. The display name is the name which is shown in the video layout during a conference. The term “display name” is already used in the UI so; please check how it was translated into the target language before.\\u0004Change display name":["Changer le nom de l\'affichage"],"An option in the context menu. Here, a user can select the audio channel that he/she wants to receive. Please note that here we are talking about a multi-language meeting assisted by interpreters.\\u0004Select interpretation channel":["Sélectionner le canal d\'interprétation"],"An option in the context menu displayed for a participant. If this option is selected, a moderator will go to the menu where one can set an individual layout for a participant.\\u0004Set custom layout":["Mise en page personnalisée"],"Filter status\\u0004Online users only":["Utilisateurs en ligne seulement"],"Message shown when the search gave no results\\u0004No matches found":["Aucun résultat trouvé"],"Additional information for conference participant\\u0004Video window %number":["Fenêtre vidéo %number"],"Additional information for conference participant\\u0004No video window":["Aucune fenêtre vidéo"],"Menu item designed to choose users for video layout\\u0004For all":["Pour tous"],"Menu item designed to choose users for video layout\\u0004For SIP/H.323 devices and WebRTC":["Pour les appareils SIP/H.323 et WebRTC"],"Menu item designed to choose users for video layout\\u0004Individual video layout":["Mode d\'affichage individuel"],"Button for adding new video layout\\u0004Add a video layout":["Ajouter un mode d\'affichage"],"Button (Number of video windows)\\u0004Number":["Numéro"],"Subheading. Used to select where to place names of the conference participants on video windows.\\u0004Name placement":["Emplacement du nom"],"User name location at the video window\\u0004At the top":["En haut"],"User name location at the video window\\u0004At the bottom":["En bas"],"Not display user name on the video window\\u0004Not display":["Non affiché"],"Enable users to change their video layout\\u0004Enable users to change layout":["Permettre aux utilisateurs de modifier le mode d\'affichage"],"Disable users to change their video layout\\u0004Ban users from changing layout":["Interdire les utilisateurs de modifier le mode d\'affichage"],"Button for selecting video layout\\u0004Layout":["Mode d\'affichage"],"The button for adding a new video layout for a conference.=\\u0004Add layout":["Ajouter une mise en page"],"A text hint for an icon button. The hint indicates that the changes in the video layout were saved, but were not applied.\\u0004Layout changes have not been applied":["Les modifications de la mise en page n\'ont pas été appliquées"],"A text hint displayed to a user who configures conference settings. To be on the podium means that a user can be seen and heard by other conference participants. Please note that the word “podium” is already used in the UI. So, you need to check how this word was previously translated into the target language. In every conference, there is a limited number of “podiums”.\\u0004Filled podiums:":["Podiums occupés :"],"This phrase is a counter indicating how many podiums (%n) have been taken by participants out of the total number (%m). Do not remove these parts of the sentence.\\u0004%n out of %m":["%n sur %m"],"A text in the dialogue window\\u0004Are you sure you want to leave the layout empty? Recipients of this layout will be unable to see one another.":["Etes-vous sûr de ne pas vouloir afficher les vidéos ? Dans ce cas, les participants ne se verront pas l\'un l\'autre."],"Title of window\\u0004Do you want to exit? The changes will not be saved.":["Voulez-vous quitter ? Les modifications ne seront pas enregistrées."],"The section heading. Here, a user will be able to create a new layout for a video conference.\\u0004New layout":["Nouvelle disposition"],"The button that will enable a user to save changes in the video layout.\\u0004Save":["Sauvegarder"],"Notification\\u0004Layout has been updated":["La disposition a été mise à jour"],"Type of video layout\\u0004Gallery view":["Afficher tous les participants en fenêtres de la même taille"],"Type of video layout\\u0004Video windows of conference participants overlap the big priority video window on the bottom":["Les fenêtres vidéo des participants à la conférence sont superposées sur la grande fenêtre vidéo principale en bas"],"Type of video layout\\u0004The big priority window is located in the left corner of the screen":["La grande fenêtre principale est située dans le coin gauche de l\'écran"],"Type of video layout\\u0004The big priority window is located at the top of the screen":["La grande fenêtre principale est située en haut de l\'écran"],"Type of video layout\\u0004The big priority window is located on the left of the screen":["La grande fenêtre principale est située à gauche de l\'écran"],"A pop-up tip displayed when the mouse cursor is pointed to the layout icon. In this context, “spotlighted” means that the window will be larger than other windows\\u0004Spotlighted window in the center":["Fenêtre éclairée au centre"],"A pop-up tip displayed when the mouse cursor is pointed to the layout icon. “Spotlighted” windows will be larger than other windows\\u0004Two spotlighted windows above smaller windows":["Deux fenêtres éclairées au-dessus de fenêtres plus petites"],"Subheading for the list of the users. Their videos are  not displayed in the general layout\\u0004Participants out of layout":["Participants non-affichés"],"Subheader for the speakers (participants on the podium)\\u0004Speakers":["Présentateurs"],"Subheader for the participants who are not on the podium\\u0004Attendees":["Participants"],"Subheader for the participants who are not on the podium\\u0004In the waiting room":["Dans la salle d\'attente"],"Subheader for the users who have not connected to the conference\\u0004Unconnected users":["Utilisateurs non connectés"],"A text hint displayed when a mouse cursor is pointed to the button. Button which opens a window for adding users to the conference.\\u0004Add users into the conference":["Ajouter des participants à la conférence"],"General name for slideshow and content sharing\\u0004Content":["Contenu"],"A notification. To be on the podium means that a user can be seen and heard by other conference participants. Please note that the word “podium” is already used in the UI. So, you need to check how it was previously translated into the target language. This hint specifies the number of podiums that can be taken by participants. The numeral 3 is hard-coded; so, no other value will be used.\\u00043 vacant podiums are remaining":["Il reste 3 podiums vacants"],"Button to open a window with detailed information\\u0004More":["Plus"],"A text hint indicating that a randomly selected conference participant will be displayed in the video window of the layout created for a meeting. Please note that %n will be replaced with the number of the window. So, do not delete or edit this part of the phrase.\\u0004%n - Random participant":["%n - Participant aléatoire"],"A text hint displayed for a video window. This hint indicates that conference participants will be rotated (shuffled) in the selected window, e.g., every 10 seconds. Please note that %n will be replaced with the number of the window. So, do not delete or edit this part of the phrase.\\u0004%n - Shuffling":["%n - Mélange"],"A text hint indicating that a certain video window is used for displaying the participant who is speaking at the moment. Please note that %n will be replaced with the number of the window. So, do not delete or edit this part of the phrase.\\u0004%n - Active speaker":["%n - Orateur actif"],"A text hint indicating that content (slides, images, or PDF files) will be displayed in the selected layout window. Please note that %n will be replaced with the number of the window. So, do not delete or edit this part of the phrase.\\u0004%n - Content":["%n -Contenu"],"A text hint indicating that no participant or content is currently displayed in the certain layout window. Please note that %n is the number of a video window. So, do not delete or edit this part of the sentence.\\u0004%n - Empty":["%n - Vide"],"A text hint displayed to a user when he/she tries to change the layout (arrangement of video windows) during a meeting. In a video lecture, the layout is fixed. There is only one person displayed in the layout (the lecturer). So, one cannot change the arrangement of windows in any way.  Please note that the term “video lecture” is already used in the UI.So, if possible, you will need to check how this term was previously translated into the target language.\\u0004The layout cannot be changed in “Video lecture” mode":["La mise en page ne peut pas être modifiée en mode \\"Lecture vidéo\\""],"The heading of a pop-up. Here, the admin can configure volume settings.\\u0004Volume settings":["Paramètres de volume"],"A subheading in the pop-up window. Here, the administrator can set the volume of the audio stream received from the speaker. Please note that the phrase “source language” is used because we are talking about a multi-language meeting assisted by interpreters.\\u0004Source language volume in interpreter channels":["Volume de la langue source dans les canaux d\'interprétation"],"The button for applying the changes made by the administrator.\\u0004Apply":["Appliquer"],"Opens additional display settings\\u0004Display settings":["Paramètres d\'affichage"],"A notification displayed to a user when he/she “locks the conference”. To lock means to make an ongoing conference inaccessible to new participants.\\u0004The conference is locked":["La conférence est verrouillée"],"A notification displayed to a user when he/she unlocks an ongoing conference; in other words, the user makes the meeting accessible to new participants.\\u0004The conference is unlocked":["La conférence est déverrouillée"],"A notification displayed when conference participants are sent to a virtual waiting room before they can participate in a meeting. They cannot be seen or heard by other users\\u0004Users will be sent to the waiting room before joining the conference":["Les utilisateurs seront envoyés dans la salle d\'attente avant de rejoindre la conférence"],"A text hint indicating that a virtual meeting is being recorded\\u0004Recording":["Enregistrement"],"An option in the conference context menu. If this option is selected, control buttons will be removed from participants’ video windows.\\u0004Hide control buttons in video windows":["Masquer les boutons de contrôle dans les fenêtres vidéo"],"An option in the context menu. If this option is selected, control buttons will be displayed in each video window added to the layout.\\u0004Show control buttons in video windows":["Afficher les boutons de contrôle dans les fenêtres vidéo"],"An option in the context menu.  If this option is selected, a conference moderator will hide the list of participants who are not displayed in the video layout.\\u0004Hide participants not added to video layout":["Masquer les participants non présentés dans la mise en page vidéo"],"An option in the context menu. If this option is selected, a conference moderator will see the list of participants who are not displayed in the video layout.\\u0004Show participants not added to video layout":["Afficher les participants non ajoutés à la mise en page vidéo"],"An option in the context menu. If this option is selected, the names of participants will be displayed in a list-like manner (each name will start from a new line).\\u0004List view":["Liste des vues"],"An option in the context menu. If this option is selected, the list of conference participants will be displayed in the tile-like manner (somewhat similar to a grid or a table).\\u0004Tile view":["Vue en grille"],"A button leading to video layout settings\\u0004Layouts":["Mises en page"],"A button enabling a user to view the list of participants\\u0004Participant List":["Liste des participants"],"A button enabling a user to view the list of participants\\u0004Participants":["Participants"],"An option in the context menu. This option opens the pop-up window where the moderator can change the unique identifier of a video meeting.\\u0004Change conference ID":["Modifier l\'identifiant de la conférence"],"A button enabling a user to extend a video meeting\\u0004Extend conference time":["Prolonger la durée de la conférence"],"An option in the context menu. This option opens the pop-up window where the moderator can change the PIN required for joining the conference.\\u0004Change PIN required for joining":["Changer le code PIN requis pour participer"],"An option in the context menu. If this option is selected, conference participants will be required to enter a PIN if they want to join a video meeting.\\u0004Request PIN for  joining":["Demande de code PIN pour participer"],"An option in the context menu. This option opens the pop-up window where the moderator can change the PIN required for joining the conferenceAn option in the context menu. This option opens the menu where the admin can set the volume of the audio stream received from the speaker. Please note that the phrase “source language” is used because we are talking about a multi-language meeting assisted by interpreters.\\u0004Source language volume":["Volume de la langue source"],"The button that enables a user to “unlock a conference” or make it available to participants. They will be able to join the ongoing meeting.\\u0004Unlock conference":["Déverrouiller la conférence"],"The button that enables a user to make an ongoing meeting inaccessible to new participants. They will no longer be able to join the meeting.\\u0004Lock conference":["Verrouiller la conférence"],"A text hint for a button that makes it possible for new participants to join an ongoing meeting.\\u0004Allow new participants to join the conference":["Permettre à de nouveaux participants de se joindre à la conférence"],"A text hint for an icon button. If this button is clicked,  new participants will no longer be able to join an ongoing meeting.\\u0004Do not allow new participants to join the conference":["Ne pas autoriser de nouveaux participants à se joindre à la conférence"],"An option in the context menu. If this option is selected, participants will immediately join the meeting without having to stay in the waiting room. Other users will see and hear them (up to 54 characters including spaces).\\u0004Disable waiting room":["Désactiver la salle d\'attente"],"An option in the context menu. If this option is selected, new conference participants will be sent to a virtual waiting room before joining a meeting. They will not be seen or heard by other users (up to 54 characters including spaces).\\u0004Enable waiting room":["Activer la salle d\'attente"],"The title of a menu where a user can start video recording\\u0004Recording":["Enregistrement"],"An option in the context menu. If this option is selected, the conference will be ended for all participants (up to 54 characters including spaces)\\u0004End for all":["Terminer pour tout le monde"],"The heading for a pop-up window. Here, the moderator can change the identifier of a video meeting.\\u0004Changing conference ID":["Changements de l\'identifiant de la conférence"],"Field name\\u0004Conference ID":["ID de la conférence"],"The button for saving changes.\\u0004Save":["Sauvegarder"],"An error message displayed if a user does not fill out a required field.\\u0004Please fill out this field":["Veuillez remplir ce champ de texte"],"Window title\\u0004Conference":["Conférence"],"HTML player code\\u0004HTML player code":["Code HTML du lecteur"],"HTML conference code\\u0004HTML conference code":["Code de conférence HTML"],"Text has been copied\\u0004Copied":["Copié"],"Conference type\\u0004Type":["Type"],"Conference type\\u0004Private":["Privé"],"Conference type\\u0004Public":["Publique"],"Conference mode\\u0004Mode":["Mode"],"The number of participants in the conference\\u0004In conference":["En conférence"],"The number of users invited to the conference\\u0004Invited users":["Utilisateurs invités"],"One of the subheadings in the menu that provides information about a video meeting.  Here, a user can check if it is possible for new participants to join an ongoing meeting.\\u0004Access status":["État d\'accès"],"A text hint in the menu that provides information about a video meeting. The hint indicates that new participants will be unable to join an ongoing meeting.\\u0004Locked":["Verrouillé"],"A subheading in the menu indicating how many conference participants (presenters) are now able to share audio and video with other users.  Other participants (attendees) can only watch and listen\\u0004Presenters on the podium:":["Présentateurs sur le podium :"],"A text hint indicating how many participants (n) are currently participating in the conference. In its turn “m”  indicates how many users may join the conference at the same time\\u0004n% (out of m%)":["n% (sur m%)"],"A subheading in the menu indicating how many people are taking part in a meeting\\u0004Conference participants:":["Participants de la conférence :"],"Conference ID\\u0004Conference ID":["ID de la conférence"],"Information about the meeting room where the conference will be held\\u0004Meeting location":["Lieu de la réunion"],"External conference page link\\u0004External page link":["Lien de page externe"],"Conference owner\\u0004Owner":["Propriétaire"],"UDP Multicast Address\\u0004UDP Multicast Address":["Adresse de UDP Multicast"],"RTSP streaming\\u0004RTSP streaming":["Streaming RTSP"],"The heading for a pop-up window. Here, the moderator can enter a PIN that participants will have to enter in order to join the meeting.\\u0004Joining with a PIN":["Rejoindre avec un code PIN"],"Text hint displayed in blank entry field\\u0004Conference PIN (4-10 digits)":["PIN de la conférence (4-10 chiffres)"],"The button for disabling the use of PIN required for joining a video conference. The users will not have to enter a PIN in order to join a video meeting.\\u0004Do not request PIN for joining":["Ne pas demander un code PIN pour la participation"],"The text hint in the pop-up window displayed to a user who tries to record a video meeting. The hint indicates that this meeting (and other meetings) will be recorded on the server. So, it is not possible to start video recording on the client side.\\u0004All conferences will be recorded on the server":["Toutes les conférences seront enregistrées sur le serveur"],"The text hint. The owner is the person who created the conference. Please check how this word was previously translated into the target language.\\u0004The conference can be recorded only by the owner or server administrator":["La conférence ne peut être enregistrée que par le propriétaire ou l\'administrateur du serveur"],"The button that ends video recording and opens the menu for saving the recording file\\u0004Stop":["Arrêter"],"A text hint in the menu where a user can start video recording\\u0004Click on the button to start recording":["Cliquez sur le bouton pour lancer l\'enregistrement"],"Title in a pop-up window. This pop-up window will be displayed when the virtual waiting room is disabled. These users cannot be seen or heard by other participants.\\u0004Disabling the waiting room":["Désactivation de la salle d\'attente"],"Notification in a pop-up window. This pop-up window will be displayed when the virtual waiting room is disabled. These users cannot be seen or heard by other participants.\\u0004What would you like to do?":["Que souhaitez-vous faire ?"],"A button.\\u0004Confirm":["Confirmer"],"A notification displayed when the moderator disables waiting room mode. Waiting room is a virtual space participants are sent to before they can join the discussion\\u0004Waiting room disabled":["Salle d\'attente désactivée"],"A radio-button. If this option is selected, all participants in the waiting room will be allowed to join the conference. They will be able to see and hear other conference participants.\\u0004Invite all":["Inviter tous"],"A radio button. If it is selected, all users, who are put in the waiting room, will be removed from the conference.\\u0004Disconnect all":["Retirer tous"],"A text hint displayed for a button. The button enables a user to open conference layout settings\\u0004Go to video layout settings":["Accéder aux paramètres de modes d\'affichage"],"A text hint for a button. When the button is clicked on, a user will open a list of participants. Besides, the user will be able to mute/unmute participants’ microphones or enable/disable their cameras.\\u0004Manage meetings participants":["Gérer les participants aux réunions"],"The heading for a pop-up displayed when the conference moderator ends a meeting\\u0004Ending a conference for all":["Terminer la conférence pour tout le monde"],"A question in the dialogue window\\u0004Do you want to end the conference for all participants?":["Souhaitez-vous mettre fin à la conférence pour tous les participants ?"],"Button to end the conference\\u0004End":["Fin"],"A section where the moderator can change some settings of an ongoing video conference. For example, it is possible to change the layout of video windows,  invite new participants, or mute / unmute participants\' microphones.  In this case there is no need to end the conference and re-start it. All the changes will take place on the fly.\\u0004Real-time management":["Gestion en temps réel"],"A button enabling a user to continue the conference for a certain period\\u0004Extend":["Étendre"],"A text hint indicating that a video recording has been saved\\u0004The recording has been saved on the server":["L\'enregistrement a été sauvegardé sur le serveur"]}}}')}}]);